import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Menu from '../data/menu.json';

export function Breakfast() {
  return (
    <div className="Show">
      ...Menues...
      <br /><br />
      {
        Menu && Menu.breakfast.map(product => {
          return (
            <div className='box' key={product.id}>
              { product.nombre }
              { product.precio }
              <img src ={ product.img} />
            
            </div>
          )
        })
      }
    </div>
  )
}
